import React, { useState, useEffect } from "react";
import { Link } from "react-scroll";
import logo from "../assets/img/logo.png";
import Main from "../main";
import About from "../about";
import Work from "../work";
import Project from "../project";
import Other from "../other";
import Contact from "../contact";

import {
  AiOutlineHolder,
  AiOutlineQrcode,
  AiTwotoneAlert,
} from "react-icons/ai";

export default function Header() {
  const [toggle, setToggle] = useState(false);

  const toggleMenu = () => {
    setToggle(!toggle);
  };

  return (
    <div className=" header-container max-w-[1200px] mx-auto p-3 bg-[#fdffff4d] sticky top-0 flex justify-between  duration-300 shadow-2xl rounded-br-3xl rounded-bl-3xl">
      <a href="/">
        <div className="logo border-[#61dafb] border-2 rounded-lg">
          <img src={logo} className="h-[50px]" alt="Logo" />
        </div>
      </a>

      <ul className="flex text-[#61dafb] justify-center items-center flex-row gap-5 text-[20px]">
        <li>
          <Link to="Main">Home</Link>
        </li>
        <li>
          <Link to="About">About</Link>
        </li>
        <li>
          <Link to="Work">Work</Link>
        </li>
        <li>
          <Link to="Contact">Contact</Link>
        </li>
        <li>
          <Link to="Other">Other</Link>
        </li>
      </ul>
    </div>
  );
}
